import React from 'react'

export const MainContent = () => {
    let formStyle = {
        width:"50%",
        padding:"50px"
    }
    return (
      <div className="container" style={formStyle}>
        <div class="mb-3">
          <label for="exampleFormControlInput1" class="form-label">
            Email address
          </label>
          <input
            type="email"
            class="form-control"
            id="exampleFormControlInput1"
            placeholder="name@example.com"
          />
        </div>
      </div>
    );
}
